import React from 'react'

const card = (props) => {
  return (
    <div>
    <div>{props.name}</div>
    <div>{props.expire}</div>
    <div>{props.points}</div>
    <div>{props.type}</div>
    <img src={props.src}></img>
  </div>
  )
}
export default card
